"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Neurogenic bladder in adults (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/neurogenic-bladder-in-adults-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H6662242\">",
"      <span class=\"h1\">",
"       What is neurogenic bladder?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Neurogenic bladder is a condition that causes problems with bladder control (",
"      <a class=\"graphic graphic_figure graphicRef79864 \" href=\"UTD.htm?26/28/27072\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H6662257\">",
"      <span class=\"h1\">",
"       What are the symptoms of neurogenic bladder?",
"      </span>",
"      &nbsp;&mdash;&nbsp;People with this condition might:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Urinate small amounts more often than usual",
"       </li>",
"       <li>",
"        Have problems starting to urinate or emptying their bladder",
"       </li>",
"       <li>",
"        Lose bladder control",
"       </li>",
"       <li>",
"        Have problems knowing if their bladder is full",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H6662272\">",
"      <span class=\"h1\">",
"       Are there tests for neurogenic bladder?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Your doctor or nurse will ask about your symptoms and do an exam. He or she might also ask you to keep a diary of your urinary habits, such as how often you empty your bladder.",
"     </p>",
"     <p>",
"      For other tests, your doctor will likely refer you to another doctor who specializes in bladder problems, such as a urologist or gynecologist. Tests you might need include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        A urine test",
"       </li>",
"       <li>",
"        A blood test",
"       </li>",
"       <li>",
"        Bladder function tests &ndash; For these tests, the doctor puts a thin tube (called a &ldquo;catheter&rdquo;) into your urethra and fills you bladder with fluid. He or she measures how much your bladder can hold. You will then release the fluid so the doctor can see if your bladder can empty all the way.",
"       </li>",
"       <li>",
"        Imaging tests &ndash; These tests create pictures of the inside of the body and can include X-rays, a CT scan, and an MRI.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H6662287\">",
"      <span class=\"h1\">",
"       Is there anything I can do on my own to feel better?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. These methods might help you to better control your bladder:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Bladder retraining &ndash; To do this, you go to the bathroom at scheduled times. For instance, you might decide that you will go every hour. You would make yourself go every hour, even if you didn&rsquo;t feel like you needed to. And you would try to wait until a whole hour had passed if you needed to go sooner. Then, once you got used to going every hour, you would increase the amount of time you waited in between bathroom visits. Over time, you might be able to &ldquo;retrain&rdquo; your bladder to wait 3 or 4 hours between bathroom visits.",
"       </li>",
"       <li>",
"        Pelvic muscle exercises - These exercises strengthen the muscles that control the flow of urine. These exercises can help, but people often do them wrong. Ask your doctor or nurse how to do them right.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H6662302\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;See your doctor or nurse right away if:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        You have new loss of bladder control, especially if you also have back pain or leg weakness.",
"       </li>",
"       <li>",
"        You have neurogenic bladder and get symptoms of a urinary tract infection (also called a &ldquo;UTI&rdquo;), which include:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Pain or a burning feeling when you urinate",
"       </li>",
"       <li>",
"        The need to urinate often",
"       </li>",
"       <li>",
"        The need to urinate right away or in a hurry",
"       </li>",
"       <li>",
"        Blood in the urine",
"       </li>",
"       <li>",
"        Fever",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H6662317\">",
"      <span class=\"h1\">",
"       How is neurogenic bladder treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatments include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Prescription medicines &ndash; Some of these medicines relax the bladder, such as",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?34/47/35574?source=see_link\">",
"         oxybutynin",
"        </a>",
"        (brand name: Ditropan &reg;) or",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?6/27/6580?source=see_link\">",
"         propantheline",
"        </a>",
"        (brand name: Pro-Banthine &reg;). Others can make certain nerves more active, such as",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?15/14/15588?source=see_link\">",
"         bethanechol",
"        </a>",
"        (brand name Urecholine &reg;). You might also need antibiotics if you get a UTI.",
"       </li>",
"       <li>",
"        Bladder catheter &ndash; If you cannot empty your bladder completely, you might need to put a thin, flexible tube (called a &ldquo;catheter&rdquo;) in your urethra a few times a day. The catheter helps you empty your bladder and avoid infection and other problems. In rare case, a permanent catheter is needed.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If your problems are more serious and medicine and a catheter are not helpful enough, you might need other treatments to control your bladder. These can include nerve stimulators, botulinum toxin (Botox) injections, and surgery.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H6662332\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?22/8/22658?source=see_link\">",
"       Patient information: Urinary incontinence (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?10/60/11202?source=see_link\">",
