var title_f16_0_16389="ECG type I sinoatrial block";
var content_f16_0_16389=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F68081&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F68081&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1056px;\">",
"  <div class=\"figure\" style=\"width: 486px\">",
"   <div class=\"ttl\">",
"    Single-lead electrocardiogram (ECG) showing lead V1 in type I (Wenckebach type) sinoatrial block",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 466px; height: 87px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    There is a 3:2 SA block, resulting in group beating of pairs of sinus beats. The P-P interval during the pause has a duration (1040 msec) that is less than two P-P cycles (1360 msec); this finding distinguishes this arrhythmia from type II SA block in which the pause duration is the same as that of two P-P cycles.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Morton Arnsdorf, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal rhythm strip",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 165px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Normal rhythm strip in lead II. The PR interval is 0.15 sec and the QRS duration is 0.08 sec. Both the P and T waves are upright.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Morton F Arnsdorf, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
