"       </td>",
"       <td>",
"        65 mcg/mL Der f 1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Timothy grass",
"       </td>",
"       <td>",
"        15&nbsp;and 20 mcg Phl p 5",
