"       </td>",
"       <td>",
"        Not determined",
"       </td>",
"       <td>",
"        10,000 BAU/mL",
"       </td>",
"       <td>",
"        225 mcg/mL Cyn d 1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cat hair or pelt",
"       </td>",
"       <td>",
"        11 to 17 mcg Fel d 1",
"       </td>",
"       <td>",
